def algo1(data,field_name1,field_name2):
  import numpy as np
  import seaborn as sns
  import matplotlib.pyplot as plt
  from sklearn.covariance import EllipticEnvelope
  sns.set_style("darkgrid")

# Make a simulated dataset with 2 features
# Normally distributed dataset

  elpenv = EllipticEnvelope(contamination=0.025, 
                          random_state=1)
  X=data[[field_name1,field_name2]]
# Returns 1 of inliers, -1 for outliers
  pred = elpenv.fit_predict(X)

# Extract outliers
  outlier_index = np.where(pred==-1)
  
  outlier_values_x=[]
  outlier_values_y=[]
  for val in outlier_index:
    outlier_values_x.append(X.iloc[val,0].values)
    outlier_values_y.append(X.iloc[val,1].values)
    

  outlier_values_x.resize(len(outlier_values_x),1)
  outlier_values_y.resize(len(outlier_values_y),1)
  #Plot the data
  # sns.scatterplot(x=X.iloc[:,0].values, y=X.iloc[:,1].values,color='b')
  # sns.scatterplot(x=outlier_values_x, 
