#zscore we will remove all the entries for which |threshold| >3 
import scipy.stats as stat
for col in data.columns:
  z_score=stat.zscore(data[f'{col}'])
  i=0
  for val in z_score:
    
    if np.abs(val) > 3:
      data.drop(data.index[i])
    i=i+1

#IQR method

for col in data.columns:
  i=0
  data[f'col']=sorted(data[f'{col}'])
  Q1,Q3=np.percentile(data[f'{col}'],[25,75])
  IQR=Q3-Q1
  lower_range=Q1-(1.5*IQR)
  upper_range=Q3+(1.5*IQR)
  print(f'for the column {col} \n')
  print(f'Q1:{Q1} \t Q3:{Q3} \t IQR:{IQR} \t lower_range:{lower_range} \t upper_range:{upper_range} \n')
  for val in data[f'{col}']:
    if val<lower_range and val>upper_range:
      data.drop(data.index[i])
      i=i+1

