"""#Imbalanced dataset
techniques of balancing an unbalanced dataset

![image.png](data:image/png;base64,)

# Let us give a short description of these metrics.

1)The accuracy of the model is basically the total number of correct predictions divided by total number of predictions.

2)The precision of a class define how trustable is the result when the model answer that a point belongs to that class.

3)The recall of a class expresses how well the model is able to detect that class.

4)The F1 score of a class is given by the harmonic mean of precision and recall (2×precision×recall / (precision + recall)), it combines precision and recall of a class in one metric.

# For a given class, the different combinations of recall and precision have the following meanings :

1)high recall + high precision : the class is perfectly handled by the model

2)low recall + high precision : the model can’t detect the class well but is highly trustable when it does

3)high recall + low precision : the class is well detected but the model also include points of other classes in it

4)low recall + low precision : the class is poorly handled by the model
In our introductory example, we have the following confusion matrix for 10000 products.













![image.png](data:image/png;base64,)

# The accuracy is 96.2% as said earlier. The non defective class precision is 96.2% and the defective class precision is not computable. The recall of the non defective class is 1.0 which is perfect (all the non defective products have been labelled as such). But the recall of the defective class is 0.0 which is the worse case (no defective products were detected). Thus, we can conclude our model is not doing well for this class. The F1 score is not computable for the defective products and is 0.981 for the non defective products. In this example, looking at the confusion matrix could have led to re-think our model or our goal (as we will see in the following sections). It could have prevented using a useless model

#Challenges with imbalanced datasets
**The conventional model evaluation methods do not accurately measure model performance when faced with imbalanced datasets.
Standard classifier algorithms like Decision Tree and Logistic Regression have a bias towards classes which have number of instances. They tend to only predict the majority class data. The features of the minority class are treated as noise and are often ignored. Thus, there is a high probability of misclassification of the minority class as compared to the majority class.
Imbalanced datasets can be found for different use cases in various domains:
Finance: Fraud detection datasets commonly have a fraud rate of ~1–2%
Ad Serving: Click prediction datasets also don’t have a high clickthrough rate.
Transportation/Airline: Will Airplane failure occur?
Medical: Does a patient has cancer?
Content moderation: Does a post contain NSFW content?**

#Handling imbalanced datasets

**1)Collect more data:**A larger dataset might expose a different and perhaps more balanced perspective on the classes.

**2)Change performance metric**:Accuracy is not the metric to use when working with an imbalanced dataset. We have seen that it is misleading.
# Looking at the following performance measures that can give more insight into the accuracy of the model than traditional classification accuracy:
Confusion Matrix: A breakdown of predictions into a table showing correct predictions (the diagonal) and the types of incorrect predictions made (what classes incorrect predictions were assigned).
Precision: A measure of a classifiers exactness.
Recall: A measure of a classifiers completeness
F1 Score (or F-score): A weighted average of precision and recall.
Kappa (or Cohen’s kappa): Classification accuracy normalized by the imbalance of the classes in the data.
Adjust the decision threshold
Adjusting misclassification costs

**3)Cost sensitive classifiers**:May be used for unbalanced data sets by setting a high cost to the misclassifications of a minority class example.

**4)Boosting Algorithm**:AdaCost, WEKA, AdaBoost, Gradient Boost, XGBoost:xgboost offers parameters to balance positive and negative weights using scale_pos_weight 

#XGBoost

**5)Weighting of examples:**It involves the creation of specific weight vectors in order to improve minority class predictions
The class-specific weights(class_weight parameter) are calculated per class whereas the test-case-specific weights are calculated for each single instance

**6)Try differnt algorithms:**Run a lot of tests on multiple models. Intuition can take you a long way in data-science — if your gut tells you that an ensemble of classifiers will give you the best results, go ahead and try it.

**7)Use stratified cross validation**

**8)Penalized svm:**In SVM where it is desired to give more importance to certain classes or certain individual samples, the parameters class_weight and sample_weight can be used.

**9)Try bagging algorithms**

**10)Data level approach:**Let’s apply some of resampling techniques using the Python library imbalanced-learn. It is compatible with scikit-learn and is part of scikit-learn-contrib projects.
"""

